;; gorilla-repl.fileformat = 1

;; **
;;; Boiler-plate code --- importing necessary things.
;; **

;; @@
(use 'nstools.ns)
(ns+ linear
  (:like anglican-user.worksheet))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; Let us define a simple query.
;; **

;; @@
(defquery linear-regression
  (let [s (sample (normal 0.0 3.0))
        b (sample (normal 0.0 3.0))
        f (fn [x] (+ (* s x) b))]
    (observe (normal (f 1.0) 0.5) 2.5)
    (observe (normal (f 2.0) 0.5) 3.8)
    (observe (normal (f 3.0) 0.5) 4.5)
    (observe (normal (f 4.0) 0.5) 6.2)
    (observe (normal (f 5.0) 0.5) 8.0)
    (predict :f f)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;linear/linear-regression</span>","value":"#'linear/linear-regression"}
;; <=

;; **
;;; Now, we lazily perform the inference.
;; **

;; @@
(def samples (drop 10000 (doquery :lmh linear-regression nil)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;linear/samples</span>","value":"#'linear/samples"}
;; <=

;; **
;;; And retrieve predicts from the lazy sequence.
;; **

;; @@
(def fs (map #(get % :f) (map get-predicts (take 1000 (take-nth 2000 samples)))))

(defn cont [x y] x)

(def state nil)

(defn apply-f 
  [f x]
  (trampoline (f cont state x)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;linear/apply-f</span>","value":"#'linear/apply-f"}
;; <=

;; **
;;; Output the data to posterior.dat
;; **

;; @@
(spit "posterior.dat" (apply str (map (fn [f] (str (apply-f f 0.0) " " (apply-f f 1.0) " ")) fs)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; And even visualize the function!
;; **

;; @@
(def xs [-1 1 2 3 4 5 6 7])
(defn draw [f]
  (let [ys (map (partial apply-f f) xs)
        xys (map (fn [x y] [x y]) xs ys)]
    (plot/list-plot xys :joined true :opacity 0.02 :plot-size 1000 :plot-range [[0 6][0 10]])))

(def xss [1 2 3 4 5])
(def drawpoints 
  (let [ys [2.5 3.8 4.5 6.2 8.0]
        xys (map (fn [x y] [x y]) xss ys)]
    (plot/list-plot xys :joined false :color "black" :plot-size 1000 :plot-range [[0 6][0 10]]
                    )))
(reduce plot/compose (concat (map draw fs) [drawpoints ]) )
