(defquery linear-regression-prior
  (let [s (sample (normal 0.0 3.0))
        b (sample (normal 0.0 3.0))
        f (fn [x] (+ (* s x) b))]
    (predict :f f)))
(def prior-samples (drop 10000 (doquery :lmh linear-regression-prior nil)))
(def prior-fs (map #(get % :f) (map get-predicts (take 1000 (take-nth 2000 prior-samples)))))

(defn cont [x y] x)

(def state nil)

(defn apply-f 
  [f x]
  (trampoline (f cont state x)))

