(def xs [-7 0 7])
(defn draw [f]
  (let [ys (map (partial apply-f f) xs)
        xys (map (fn [x y] [x y]) xs ys)]
    (plot/list-plot xys :joined true :opacity 0.05 :color "blue" :plot-size 1000 :plot-range [[-6 6][-5 5]])))


(reduce plot/compose  (map draw prior-fs) )
